class Dog{
	String name;
	String color;
	int cost;
	String breed;
	int age;
	
	public Dog() {
		// TODO Auto-generated constructor stub
	}

	public Dog(String name, String color, int cost, String breed, int age) {
		super();
		this.name = name;
		this.color = color;
		this.cost = cost;
		this.breed = breed;
		this.age = age;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	public String getColor() {
		return color;
	}

	public void setColor(String color) {
		this.color = color;
	}

	public int getCost() {
		return cost;
	}

	public void setCost(int cost) {
		this.cost = cost;
	}

	public String getBreed() {
		return breed;
	}

	public void setBreed(String breed) {
		this.breed = breed;
	}

	public int getAge() {
		return age;
	}

	public void setAge(int age) {
		this.age = age;
	}
	
	
}
